import React from 'react';
import { useNavigate } from 'react-router-dom';

import logo from '../../img/UCF.png';

function SuperAdminForm({ setUsernameReg, setPasswordReg, setEmailReg, RegisterSuperAdminFunc })
{
    // Used to navigate to the login page
    const navigate = useNavigate();
    
    return (
        <div className='container'>
        <div className='navButtons'>
          <div className='logo'>
                    <img src={ logo } alt='UCF logo'/>
          </div>
          <button onClick={() => navigate('/')}>Login</button>
          <button onClick={() => navigate('/registerStudent')}>Student Registration</button>
        </div>
        <div className='form'>
          <h1>Superadmin Registration</h1>
          <div className='formGroup'>
            <label>Username:</label>
            <input 
              type="text"
              onChange={(e) => {
                setUsernameReg(e.target.value);
              }}>
            </input>
          </div>
          <div className='formGroup'>
            <label>Email:</label>
            <input 
              type="text"
              onChange={(e) => {
                setEmailReg(e.target.value);
              }}>
            </input>
          </div>
          <div className='formGroup'>
            <label>Password:</label>
            <input 
              type="password"
              onChange={(e) => {
                setPasswordReg(e.target.value);
              }}>
            </input>
          </div>
          <div className='buttons'>
            <button onClick={RegisterSuperAdminFunc}>Register</button>
          </div>
        </div>
      </div>
    );
};

export default SuperAdminForm;
